import CardsItem from "./CardItem"



const CardsList = ({cards}) => {
    const allCardsList = cards.map((card) => {
        return <CardsItem card={card} key={cards._id} />
    });

    return(
        <div>
            <ul>
                {allCardsList}
            </ul>
        </div>
    )
}

export default CardsList
